import { makeStyles } from "@mui/styles";

const RegisterStyle = makeStyles({
    Box : {
        display: "flex",
        flexDirection: "column",
        margin: "100px 30vw 0 30vw",
        justifyContent: "center",
        alignItems: "center",
        gap: "1rem",
        backgroundColor: "red"
    }
})

export default RegisterStyle
